import './ExpenseItem.css';

function ExpenseItems() {
  return (
    <div className=".expense-item">
      <div>27th Jan 2023</div>
      <div className=".expense-item__description">
        <h2>Car Insurance</h2>
        <div className=".expense-item__price">$989</div>
      </div>
    </div>
  );
}

export default ExpenseItems;
